import React from 'react';

function Navbar() {
    return (
        <div>
            <nav className="navbar navbar-light bg-primary-subtle">
                <h1 className="ms-5">Buscaminas</h1>
                <img src="https://media.fortniteapi.io/images/594db1146768bade868f7b5f332ad778/transparent.png" alt="mine" width="50" height="50" />
            </nav>
        </div>
    );
}

export default Navbar;
